@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:LogFile a owl:Class .

atm:Update a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:updates ;
        owl:someValuesFrom atm:LogFile
    ] .

atm:updates a owl:ObjectProperty ;
    rdfs:domain atm:Update ;
    rdfs:range atm:LogFile .
